import React from 'react';
const Tail = () => {
    return ( 
    <div className="w3-container w3-margin w3-round-xlarge w3-light-gray ">
    <div className="w3-container w3-display-container" >
    <div className="w3-display-right"  >
      <img src="https://www.w3schools.com/w3css/img_avatar3.png" alt="Avatar" className="w3-circle" style={{  width: '40px' }} />
    </div>
    </div>
    <div className="w3-container">
      <p className="w3-text-grey" style={{ fontSize: '1.1em',marginTop: '0.5em',marginBottom: '0.2em' }} ><b>Anger Management</b></p>
    </div>
  </div> );
}

export default Tail;
